	  function onSucessGetChamada(cham, infoTurma) {
        doc = new jsPDF({orientation: 'l', unit: 'mm', format: 'a4',});
        var turmaDisc = infoTurma["nome"].split(' - ');
		var dataCham =  cham["data"];
        var totCham = dataCham.length;
		var mesCham = {};
		var diaCham = [];        
        var mesAnt = 0;
		var fimPosMesAnt = 0; //em qual coluna encerra o mes
		var totPorPag = 35;
        for (var i = 0; i < totCham; i++) {
          var aux = dataCham[i].split('-');
          var mes = parseInt(aux[1], 10);
		  diaCham[i] = aux[2];
          if(mes.toString().localeCompare("") != 0 && mes != mesAnt) {
			mesCham[fimPosMesAnt] = { "mes": nomeMes[mesAnt],
									  "tam": i - fimPosMesAnt
									}
            mesAnt = mes;
			fimPosMesAnt = i;
          }
        }
		mesCham[fimPosMesAnt] = { "mes": nomeMes[mesAnt],
								  "tam": i - fimPosMesAnt
								}
		var info = {
			"prof": infoProf[0],
			"turma": turmaDisc[0],
			 "disc": turmaDisc[1],
			  "ano": infoAno,
			  "mes": mesCham,
			  "dia": diaCham
		}
		var infoAlunos = infoTurma["alunos"];
		var cont = 0;
		for (var id in infoAlunos) {
			cont++;
			frequenciaAluno(cont, infoAlunos[id], cham[infoAlunos[id][0]]);
			
			if (cont > totPorPag) {
				cabecalhoElayoutChamada(info, mesCham, cont);
				doc.addPage();
				cont = 0;
			}
		} 
		cabecalhoElayoutChamada(info, mesCham, cont);
        window.open(doc.output('bloburl'), '_blank');
      }

	function  frequenciaAluno(num, infoAl, chamAl) {
        var row = 4;
        var col = 4;
        var iniDiario = 82;
        var iniCham = iniDiario + 2;
        var colNota = 6;
        var iniVer = 48;
		var totCham = chamAl.length;
        doc.setTextColor(0, 100, 255);
        doc.setFontSize(8);
		num = ('0' + num).slice(-2);
		doc.text(num, 13, iniVer + num*row, 'center');
		doc.text(abreviaNome(infoAl[1], 40).toUpperCase(), 18, iniVer + num*row);
        doc.setFont('times', 'normal')
        for (var i = 0; i < totCham; i++) {         
			if(chamAl[i].localeCompare("F") == 0)
			  doc.setTextColor(255, 0, 0);
			else
			  doc.setTextColor(0, 100, 255);
			doc.text(chamAl[i], iniCham + i*col, iniVer + num*row, 'center');     
		}
     }

	function  cabecalhoElayoutChamada(infoTurma, mesCham, totPag) {   
		var row = 4;
        var col = 4;
        var iniDiario = 82;
        var iniCham = iniDiario + 2;
        var iniVer = 48;
		var dia = infoTurma["dia"];
		var mes = infoTurma["mes"];
		var totCham = dia.length;
        doc.addImage(brasao, 'PNG', 250, 8, 34.484, 14.8);
        doc.setFontSize(13);
        doc.setFont('times', 'bold');
        doc.setTextColor(0, 0, 0);
		doc.text(150, 12, 'COLÉGIO PEQUENO APRENDIZ', 'center');
		doc.setFontSize(11);
        doc.text('Professor:   '+ infoTurma["prof"], 10, 20);
        doc.text('Turma:   ' + infoTurma["turma"] + '     |     ANO LETIVO: '+ infoTurma["ano"], 10, 25);
		var disc = (nameDisc[infoTurma["disc"]] ? nameDisc[infoTurma["disc"]] : infoTurma["disc"]);
        doc.text('Disciplina:   '+ disc, 10, 30);
        doc.setFontSize(9)
        doc.text('Nº', 13, iniVer, 'center');
        doc.text('Nome', (16 + iniDiario)/2, iniVer, 'center');
        doc.setLineWidth(0.5)
        doc.line(10, (iniVer-3), 10,(totPag+1) * row +(iniVer-3)) //left
        doc.line(16, (iniVer-3), 16,(totPag+1) * row +(iniVer-3)) //left
        doc.line(iniDiario, (iniVer-7), iniDiario,(totPag+2) * row +(iniVer-7)) //left
        doc.line(iniDiario + totCham * col, (iniVer-7), iniDiario + totCham * col,(totPag+2) * row +(iniVer-7)) //right
        doc.line(10, (iniVer-3), iniDiario + totCham * col, (iniVer-3)) //top
        doc.line(iniDiario, (iniVer-7), iniDiario + totCham * col, (iniVer-7)) //top
        doc.line(10, (totPag+1) * row + (iniVer-3), iniDiario + totCham * col, (totPag+1) * row +(iniVer-3)) //botton
        doc.setLineWidth(0.1);
        doc.line(iniDiario, (iniVer-3), iniDiario + totCham * col, (iniVer-3)) //top
        for (var i = 0; i < totCham; i++) {
			doc.line(iniDiario + i*col, (iniVer-3), iniDiario + i*col, (totPag+1) * row +(iniVer-3));
			if (mes[i]) {
				var mesCham = (mes[i]["tam"] > 3 ? mes[i]["mes"] : mes[i]["mes"].substring(0, 3));
				doc.text(mesCham, iniDiario + (i+(mes[i]["tam"]/2))*col, iniVer - row, 'center'); //mes
				doc.line(iniDiario + i*col, (iniVer-7), iniDiario + i*col,(iniVer-1))
			}
			doc.text(dia[i], iniCham + i*col, iniVer, 'center'); //dia
		}
        doc.setLineWidth(0.1);
        for (var i = 1; i <= totPag; i++)
          doc.line(10, (iniVer-3) + i*row, iniDiario + totCham * col, (iniVer-3) + i*row)
     }

	  function onSucessPrintNotas(notas, infoTurma) {
		doc = new jsPDF({orientation: 'p', unit: 'mm', format: 'a4',});
		var turmaDisc = infoTurma["nome"].split(' - ')
		var totPorPag = 35;
		var infoAlunos = infoTurma["alunos"];
		var aval = notas["avaliacao"];
		var info = {
			"prof": infoProf[0],
			"turma": turmaDisc[0],
			 "disc": turmaDisc[1],
			  "ano": infoAno,
		}
		var cont = 0;
		for (var id in infoAlunos) {
			cont++;
			notasAluno(cont, infoAlunos[id], notas[infoAlunos[id][0]]);
			if (cont > totPorPag) {
				pagNotas(aval, info, cont);
				doc.addPage();
				cont = 0;
			}
		}
		pagNotas(aval, info, cont);
		window.open(doc.output('bloburl'), '_blank');
		aviso("Relatório de notas - "+turmaDisc+" - gerado com sucesso!");
		doc = null;
      }

	  function  notasAluno(num, infoAl, aval) {
		var largura = 5.864;
        var row = 4.54;
        var comHor = 10;
        var comHorNotas = 82;
        var comVer = 48;
        var comVerNotas = comVer+29.5;;
		var totNotas = aval.length;
		doc.setFontSize(9)
		doc.setFont('times', 'bold')
		doc.setTextColor(0, 100, 255);
		doc.setFont('times', 'normal');
		doc.text(abreviaNome(infoAl[1], 40).toUpperCase(), 18, comVerNotas + num*row );
		for (var i = 0; i < totNotas; i++) {
			doc.setFontSize(9);			
			if (i == (totNotas - 1)) {
				doc.setTextColor(0, 100, 255);
				aval[i] = aval[i].toString();
			} else {
				if(parseFloat(aval[i],10) < 5.0)
					doc.setTextColor(255, 0, 0);
				else
					doc.setTextColor(0, 100, 255);
				if (aval[i].localeCompare("10.0") == 0)
					doc.setFontSize(8);
				aval[i] = aval[i].replace('.', ',');
			}
			doc.text(aval[i], comHorNotas + 3 + i*largura, comVerNotas + num*row, 'center');
		}
     }

      function  pagNotas(aval, infoTurma, totAluno) {
		var totNotas = aval.length;//11;
        var largura = 5.864;
        var row = 4.54;
        var comHor = 10;
        var comHorNotas = 82;
        var comVer = 48;
         var comVerNotas = comVer+30;
        var fimVer = comVerNotas + totAluno * row;
        doc.setFontSize(11);
        doc.setFont('times', 'bold');
        doc.setTextColor(0, 0, 0);
		doc.addImage(brasao, 'PNG', 170, 8, 34.484, 14.8);
        doc.setFontSize(13);
        doc.setFont('times', 'bold');
        doc.setTextColor(0, 0, 0);
		doc.text(105, 12, 'COLÉGIO PEQUENO APRENDIZ', 'center');
		doc.setFontSize(11);
        doc.text('Professor:   '+ infoTurma["prof"], 10, 20);
        doc.text('Turma:   ' + infoTurma["turma"] + '     |     ANO LETIVO: '+ infoTurma["ano"], 10, 25);
		var disc = (nameDisc[infoTurma["disc"]] ? nameDisc[infoTurma["disc"]] : infoTurma["disc"]);
        doc.text('Disciplina:   '+ disc, 10, 30);      
        doc.setTextColor(0, 0, 0);
        doc.setFontSize(9);
		doc.text('Nº', (comHor+16)/2, comVerNotas-.6, 'center');
        doc.text('Nome', (16 + comHorNotas)/2, comVerNotas-.6, 'center');
        doc.setFontSize(9);
        doc.setFont('times', 'bold')
        for (var j = 1; j <= totAluno; j++) {
          var num = j.toString(); 
          if (j < 10)
            num = '0' + num;
          doc.text(num, comHor+1.5, comVerNotas-1 + j*row);
        }
        doc.setLineWidth(0.5)
        doc.line(comHor, comVer, comHor, fimVer) //left
		doc.line(comHor + 6, comVerNotas, comHor + 6, fimVer) //left
        doc.setLineWidth(0.1);
        doc.line(comHorNotas, comVer, comHorNotas, fimVer);
        
        for (var i = 0; i < totNotas; i++) {
          if (i < (totNotas - 2)) //avaliacoes do prof
			doc.setTextColor(0, 100, 255);
		  else
			  doc.setTextColor(0, 0, 0); //media e faltas
		  doc.line(comHorNotas + i*largura, comVer, comHorNotas + i*largura, fimVer);
		  doc.text(aval[i], comHorNotas+4 + i*largura, comVerNotas-.6, null, 90);
		}
        doc.line(comHor, comVer, comHorNotas + totNotas * largura, comVer) //top        
        doc.setLineWidth(0.1);
        for (var i = 1; i < totAluno; i++)
          doc.line(comHor, comVerNotas + i*row, comHorNotas + totNotas * largura, comVerNotas + i*row)
        doc.setLineWidth(0.5);
        doc.line(comHor, comVerNotas, comHorNotas + totNotas * largura, comVerNotas) 
        doc.line(comHor, fimVer, comHorNotas + totNotas * largura, fimVer) //botton
        doc.line(comHorNotas + totNotas*largura, comVer, comHorNotas + totNotas*largura, fimVer) //right
      }
	  
	   

